import {
  IonContent,
  IonHeader,
  IonTitle,
  IonToolbar,
  IonPage,


} from '@ionic/react';
import React from 'react';


const EntryPage: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Entry</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
      Placetext entry
      </IonContent>
      </IonPage>
  );
};

export default EntryPage;
